import React from 'react';
import styled from 'styled-components';
import background from '../assets/bg.svg';

const Home = () => {
  return (
    <>
      <img
        src="https://raw.githubusercontent.com/MatheusVBLima/Template-Eng-Soft/4432bb7639c259fcbb3c8edd758c0b4fda657688/imagens/bg.svg"
        width="100px"
        height="100px"
      />
      <HomeWrapper>Hello, world</HomeWrapper>
    </>
  );
};

const HomeWrapper = styled.div`
  color: black;
  font-size: 500px;
  width: 100vw;
  height: 100vh;
  background-image: url(../assets/bg.svg);
`;

export default Home;
